import random
import numpy as np

class Centroid:
    def __init__(self, location):
        self.location = location
        self.closest_users = set()


def manhattan_distance(X, Y):
    new_list = [0 for x in X]
    for i in range(len(X)):
        new_list[i] = abs(X[i] - Y[i])
    return sum(new_list)

def features_mean(matrix):
    matrix = np.matrix(matrix)
    mean = matrix.mean(0).tolist()[0]
    return mean

def get_k_means(user_feature_map, num_features_per_user, k):
    # Don't change the following two lines of code.
    random.seed(42)
    # Gets the inital users, to be used as centroids.
    inital_centroid_users = random.sample(sorted(list(user_feature_map.keys())), k)

    centroids = [Centroid(user_feature_map[i]) for i in inital_centroid_users]

    average_features = [float(100) for x in range(num_features_per_user)]

    iterations = 0
    # average_changed = False
    #run at least 10 iterations and if the averages have changed
    while iterations < 10:
        # print(iterations)
        #iterate over user features
        for user, feature_map in user_feature_map.items():
            distances = {}
            # for each centroid, if it's not itself (1st iteration since it's initialized randonmly)
            # calculate the distance between centroid and user and store in distances
            for c in centroids:
                if c.location != feature_map:
                    distances[c] = manhattan_distance(c.location, feature_map)
            #sort the distances to get the closest one
            sorted_distances = dict(sorted(distances.items(), key=lambda item: item[1])[:k])
            # to cover k = 1
            if not sorted_distances:
                continue
            #get the closest centroid
            closest_centroid = list(sorted_distances.keys())[0]
            # update the closest_centroid and add the user
            for c in centroids:
                if c == closest_centroid:
                    c.closest_users.add(user)
        # once we've gone through all the users, it's time to calculate the average among all users per centroid
        for c in centroids:
            # check if the average_features haven't changed, and if they haven't then stop
            keys = list(c.closest_users)
            average_features = features_mean([user_feature_map[x] for x in keys])
            if c.location != average_features:
                c.location = average_features
        iterations = iterations + 1
    return [centroid.location for centroid in centroids]



